import React from 'react';
import './Navbar.css';
import logo from '../../logo.png'

const Navbar = ({
    title,
    onPress,
    buttonColor,
    titleColor,
    buttonStyle,
    textStyle,
}) => {
    return (
        <div className='container Navbar'>
            <div className="row">
                <div className="col sm-1 logoDiv">
                    <img src={logo} className="Nav-logo" alt="logo" />
                </div>
                <div className="col sm-5">
                </div>
                <div className="col sm-4" NavContainer>
                    <div className="NavLink">Home </div>
                    <div className="NavLink">I have a Sustainable Idea</div>
                    <div className="NavLink">I want to support </div>
                    <div className="NavLink">Contact</div>
                </div>
            </div>
        </div>

    );
};

export default Navbar;
